sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var parsedData = JSON.parse(inputs.response);
  var assetObj = {}
  var eth_price = parsedData.collection.payment_tokens[0].usd_price;

  assetObj.average_price = eth_price * parsedData.collection.stats.average_price;
  assetObj.eth_price = eth_price;
  assetObj.total_sales = parsedData.collection.stats.total_sales;
  assetObj.one_day_average_price = parsedData.collection.stats.one_day_average_price;
  assetObj.thirty_day_sales = parsedData.collection.stats.thirty_day_sales;
  assetObj.one_day_sales = parsedData.collection.stats.one_day_sales;
  assetObj.num_owners = parsedData.collection.stats.num_owners;
  outputs.asset = assetObj;
})(inputs, outputs);

